import React from 'react';
import './Add.css';
import Title from '../../components/title/Title';

const Add = () => {
  return (
    <div className='add p-4'>
      <Title title='add doctor' />
      <form className='p-4'>
        <div className='upload'>
          <label id='upload'><i class="fa-solid fa-user"></i></label>
          <input for='upload' type='file' />
          <p>Upload doctor picture</p>
        </div>
      </form>
    </div>
  )
}

export default Add
